INSERT INTO `articles` VALUES (130,'What Consumers Really Think Of Coca-Cola’s Plastic Bottles','When a Coca-Cola executive talked about the company\'s plastic bottles during the annual meeting for the World Economic Forum, she explained that consumers preferred them. However, a new survey from Piplsay revealed that consumers are more open-minded than some corporations believe.',NULL,NULL,'2020-01-27 00:00:00','Neutral','https://www.forbes.com/sites/lanabandoim/2020/01/27/what-consumers-really-think-of-coca-colas-plastic-bottles/','https://cdn.snapi.dev/images/v1/w/h/what-consumers-really-think-of-coca-colas-plastic-bottles.jpg','Forbes','KO','Environment','0.75'),(131,'Coca-Cola Sweden First Market To Adopt Fully Recycled Plastic','Coca-Cola Sweden will make all its plastic bottles from recycled material from next year on, the company announced last week.',NULL,NULL,'2019-11-27 00:00:00','Neutral','https://www.forbes.com/sites/emanuelabarbiroglio/2019/11/27/coca-cola-sweden-first-market-to-adopt-fully-recycled-plastic/','https://cdn.snapi.dev/images/v1/9/6/960x0-10.jpg','Forbes','KO','Environment','0.63'),(132,'Coca-Cola chooses plastic bottle collection over aluminum cans to cut carbon footprint','Coca-Cola  is committed to collecting and recycling plastic bottles rather than switching to aluminum cans as the world\'s largest soft drinks maker seeks to reduce its carbon footprint, its chief executive officer told Reuters.',NULL,NULL,'2019-11-06 00:00:00','Neutral','https://www.reuters.com/article/us-coca-cola-plastic-aluminium/coca-cola-chooses-plastic-bottle-collection-over-aluminum-cans-to-cut-carbon-footprint-idUSKBN1XG2J6','https://cdn.snapi.dev/images/v1/n/i/m02d20191106t2i1449109712rlynxmpefa51tcw640.jpg','Reuters','KO','Environment','0.68'),(133,'Japan\'s Suntory joins rival Coca Cola to push Vietnam on plastic recycling','Japanese beverage giant Suntory Holdings said it would work with rival Coca-Cola as well as Nestle to push the government in Vietnam, among the biggest contributors to plastic waste in the ocean, to create a large-scale recycling system.',NULL,NULL,'2019-06-25 00:00:00','Positive','https://www.reuters.com/article/us-suntory-vietnam-recycling/japans-suntory-joins-rival-coca-cola-to-push-vietnam-on-plastic-recycling-idUSKCN1TQ1WK','https://cdn.snapi.dev/images/v1/m/0/m02d20190625t2i1401382643rlynxnpef5o163w640.jpg','Reuters','KO','Environment','0.73'),(134,'Apple’s Newest Product: Face Shields For Doctors, Nurses Fighting Coronavirus','Also, donating 20 million face masks for medical professionals.',NULL,NULL,'2020-04-05 00:00:00','Neutral','https://www.forbes.com/sites/johnkoetsier/2020/04/05/apples-newest-product-face-shields-for-doctors-nurses-fighting-coronavirus/','https://cdn.snapi.dev/images/v1/u/l/apples-newest-product-face-shields-for-doctors-nurses-fighting-coronavirus.jpg','Forbes','AAPL','Health-&-Wellness','0.82'),(135,'Apple doubles China donations for COVID-19 recovery efforts','Apple more than doubled its donation to China\'s efforts to fight COVID-19 to over 50 million yuan ($7 million), CEO Tim Cook posted on Weibo on Wednesday, weeks after the iPhone maker said it had opened all its 42 stores in one of its largest markets.',NULL,NULL,'2020-04-01 00:00:00','Positive','https://www.reuters.com/article/us-health-coronavirus-apple/apple-doubles-china-donations-for-covid-19-recovery-efforts-idUSKBN21J45L','https://cdn.snapi.dev/images/v1/7/2/app9-5.jpg','Reuters','AAPL','Health-&-Wellness','0.67'),(145,'Tesla cuts price for China-made Model 3 cars by 10% to qualify for subsidies','U.S. electric vehicle maker Tesla Inc  said in Friday it has cut the starting price for China-made Model 3 sedans by 10% to qualify for subsidies in the world\'s biggest auto market.',NULL,NULL,'2020-04-30 00:00:00','Neutral','https://www.reuters.com/article/us-tesla-china-price/tesla-cuts-price-for-china-made-model-3-cars-by-10-to-qualify-for-subsidies-idUSKBN22D458','https://cdn.snapi.dev/images/v1/z/p/gettyimages-1044441350jpegw601.jpg','Reuters','TSLA','Environment','0.89'),(146,'Tesla\'s Musk nears $750 million options payday ahead of results','Tesla Inc Chief Executive Elon Musk is on the cusp of a roughly $750 million payday as the electric carmaker\'s stock recovers from a slump caused by the coronavirus, which led the company to close its factories and furlough workers.',NULL,NULL,'2020-04-28 00:00:00','Positive','https://www.reuters.com/article/us-tesla-stocks-musk/teslas-musk-nears-750-million-options-payday-ahead-of-results-idUSKCN22A16B','https://cdn.snapi.dev/images/v1/p/a/105786681-1552323674808gettyimages-1128344984530x298.jpeg','Reuters','TSLA','Environment','0.63'),(147,'Tesla surges 28% in two days as traders look beyond coronavirus disruption','Shares of Tesla Inc  surged 12% on Tuesday after Credit Suisse upgraded its rating on the electric carmaker and as Wall Street rallied on optimism the coronavirus outbreak was reaching a plateau.',NULL,NULL,'2020-04-14 00:00:00','Positive','https://www.reuters.com/article/us-tesla-stocks/tesla-surges-28-in-two-days-as-traders-look-beyond-coronavirus-disruption-idUSKCN21W2K3','https://cdn.snapi.dev/images/v1/w/i/tesla45.jpg','Reuters','TSLA','Environment','0.76'),(148,'Tesla expands locally made line-up, helping reduce trade war impact','U.S. electric vehicle maker Tesla Inc  said on Friday it has started China sales of two lower-priced Model 3 variants built at its Shanghai plant, meaning all Model 3 sedans sold in the country are now locally made and not subject to import tax.',NULL,NULL,'2020-04-10 00:00:00','Positive','https://www.reuters.com/article/us-tesla-china/tesla-expands-locally-made-line-up-helping-reduce-trade-war-impact-idUSKCN21S0F0','https://cdn.snapi.dev/images/v1/a/u/105926045-1559662919891gettyimages-1149766443r.jpg','Reuters','TSLA','Environment','0.65'),(149,'Tesla starts selling two new locally made Model 3 variants in China','U.S. electric vehicle maker Tesla Inc  said on Friday it has started selling two new locally made Model 3 sedan variants in China.',NULL,NULL,'2020-04-10 00:00:00','Positive','https://www.reuters.com/article/us-tesla-china/tesla-starts-selling-two-new-locally-made-model-3-variants-in-china-idUSKCN21S0F0','https://cdn.snapi.dev/images/v1/h/3/tes23-2.jpg','Reuters','TSLA','Environment','0.65'),(150,'\'Dear Elon\': Ukraine takes up Tesla\'s ventilator offer via Twitter','Ukraine has taken to Twitter to ask Elon Musk to send it ventilators after the billionaire chief executive of Tesla Inc  offered to ship them across the world during the coronavirus pandemic.',NULL,NULL,'2020-04-02 00:00:00','Neutral','https://www.reuters.com/article/us-health-coronavirus-ukraine-tesla/dear-elon-ukraine-takes-up-teslas-ventilator-offer-via-twitter-idUSKBN21K1UX','https://cdn.snapi.dev/images/v1/n/v/tsl09.jpg','Reuters','TSLA','Health-&-Wellness','0.76'),(151,'Tesla plans to supply FDA-approved ventilators free of cost: Musk','Tesla Inc  Chief Executive Elon Musk said on Tuesday the company has extra FDA-approved ventilators that can be shipped free of cost to hospitals within regions where the electric carmaker delivers.',NULL,NULL,'2020-03-31 00:00:00','Positive','https://www.reuters.com/article/us-health-coronavirus-tesla/tesla-plans-to-supply-fda-approved-ventilators-free-of-cost-musk-idUSKBN21I2KX','https://cdn.snapi.dev/images/v1/1/2/498.jpg','Reuters','TSLA','Health-&-Wellness','0.68'),(156,'This level \'would be the all clear\' for Apple\'s stock as iPhone maker heads into earnings: Chart analyst','As Apple prepares to report earnings after Thursday\'s closing bell, Todd Gordon of Ascent Wealth Partners is watching one key level on its chart for an \"all clear.\"',NULL,NULL,'2020-04-30 00:00:00','Positive','https://www.cnbc.com/2020/04/30/apple-q2-2020-earnings-lookahead-and-what-to-watch-after-the-report.html','https://cdn.snapi.dev/images/v1/3/l/m02d20190619t2i1399414710rlynxnpef5i1ehw640.jpg','CNBC','AAPL','Environment','0.62'),(157,'By Ju