ces-of-revenue/','https://cdn.snapi.dev/images/v1/p/t/pt-25-193270-o.jpg','Forbes','ABT','Health-&-Wellness','0.72'),(161,'Julie Sweet to Run Accenture, Adding a Woman to the Ranks of Corporate C.E.O.s','Her appointment raises the number of women at the helm of the most valuable U.S. public companies to 27, but that is just slightly more than 5 percent of those firms.',NULL,NULL,'2019-07-11 00:00:00','Positive','https://www.nytimes.com/2019/07/11/business/julie-sweet-accenture-ceo.html','https://cdn.snapi.dev/images/v1/e/d/edd23-1.jpg','NYTimes','ACN','Human-Resources-&-Diversity','0.69'),(162,'Adobe\'s stock jumps to record close as investors cheer cloud transition','Adobe rose almost 4% on Friday, closing at an all-time high and reflecting the company\'s extended move from desktop software to the cloud.',NULL,NULL,'2019-12-13 00:00:00','Positive','https://www.cnbc.com/2019/12/13/adobe-stock-hits-new-record-as-investors-cheer-move-to-cloud.html','https://cdn.snapi.dev/images/v1/y/t/104172678-gettyimages-489442558.jpg','CNBC','ADBE','Environment','0.67'),(163,'Migraine sufferers have new oral medication with FDA approval of Allergan\'s Ubrelvy','Ubrelvy is proven to ease migraine symptoms in two hours.',NULL,NULL,'2019-12-26 00:00:00','Positive','https://www.cnbc.com/2019/12/26/migraine-sufferers-have-new-tool-with-approval-of-allergans-ubrelvy.html','https://cdn.snapi.dev/images/v1/e/h/101659206-486159811.jpg','CNBC','AGN','Health-&-Wellness','0.71'),(164,'This Stock Is Like Tesla, Minus The Risk','The electric vehicle (EV) megatrend is ramping up, but Tesla isn’t the best way to play it.',NULL,NULL,'2020-02-19 00:00:00','Positive','https://www.forbes.com/sites/stephenmcbride1/2020/02/19/this-stock-is-like-tesla-minus-the-risk/','https://cdn.snapi.dev/images/v1/3/h/this-stock-is-like-tesla-minus-the-risk.jpg','Forbes','ALB','Environment','0.73'),(165,'Allstate to return $600 million in auto premiums as pandemic cuts driving','U.S. insurer Allstate Corp  said on Monday it would return more than $600 million in auto insurance premiums to customers as many Americans drive less due to \"shelter-in-place\" orders to curb the coronavirus outbreak.',NULL,NULL,'2020-04-06 00:00:00','Positive','https://www.reuters.com/article/us-health-coronavirus-insurance-auto/allstate-to-return-600-million-in-auto-premiums-as-pandemic-cuts-driving-idUSKBN21O1IN','https://cdn.snapi.dev/images/v1/f/4/m02d20200406t2i1513113562rlynxmpeg3510qw640.jpg','Reuters','ALL','Environment','0.67'),(166,'How Important Is Cost Of Sales To AMD’s Expenses And Overall Profitability?','Advanced Micro Devices’ (NASDAQ: AMD) total expenses have risen gradually from around $4.82 billion in 2016 to about $6.14 billion in 2018.',NULL,NULL,'2020-01-13 00:00:00','Positive','https://www.forbes.com/sites/greatspeculations/2020/01/13/how-important-is-cost-of-sales-to-amds-expenses-and-overall-profitability/','https://cdn.snapi.dev/images/v1/h/o/how-important-is-cost-of-sales-to-amds-expenses-and-overall-profitability.jpg','Forbes','AMD','Health-&-Wellness','0.74'),(167,'AMD shares surge 14% after Google and Twitter say they\'re using the chipmaker\'s new processor','AMD launched its new data center chip for high-performance computing on Wednesday, and customers include Google and Twitter.',NULL,NULL,'2019-08-08 00:00:00','Positive','https://www.cnbc.com/2019/08/08/amd-shares-surge-14percent-after-google-and-twitter-sign-on-with-epyc-chips.html','https://cdn.snapi.dev/images/v1/2/x/105969521-1560525954111gettyimages-1079804120.jpg','CNBC','AMD','Environment','0.82'),(168,'Amgen results beat estimates, lung cancer trial planned','Amgen said its second-quarter revenue fell 3% due to more competition for its older off-patent drugs.',NULL,NULL,'2019-07-31 00:00:00','Positive','https://www.cnbc.com/2019/07/31/amgen-results-beat-estimates-lung-cancer-trial-planned.html','https://cdn.snapi.dev/images/v1/i/o/103973226-1548793652023gettyimages-563574597.jpg','CNBC','AMGN','Health-&-Welln