-sees-big-2020-medicare-and-medicaid-growth.jpg','Forbes','ANTM','Health-&-Wellness','0.63'),(173,'Data And Analytics Key To Health Outcomes, Anthem CEO Says','Health insurance giant Anthem will continue to invest in data and analytics to improve health outcomes and reduce costs, CEO Gail Boudreaux said at the 2019 Forbes Healthcare Summit.',NULL,NULL,'2019-12-05 00:00:00','Positive','https://www.forbes.com/sites/brucejapsen/2019/12/05/data-and-analytics-key-to-health-outcomes-anthem-ceo-says/','https://cdn.snapi.dev/images/v1/m/w/ant63.jpg','Forbes','ANTM','Health-&-Wellness','0.86'),(174,'Anthem Adds 1M Enrollees Ahead Of Medicare Sign-Up Period','The nation’s largest health insurer said its total medical enrollment was 41 million as of Sept. 30, the end of the third quarter thanks largely to “fully insured” enrollment that benefits health plan premium revenues.',NULL,NULL,'2019-10-23 00:00:00','Positive','https://www.forbes.com/sites/brucejapsen/2019/10/23/anthem-adds-1m-enrollees-ahead-of-medicare-sign-up-period/','https://cdn.snapi.dev/images/v1/a/n/ant63.jpg','Forbes','ANTM','Health-&-Wellness','0.80'),(175,'Health insurer Anthem has hired a bunch of Apple employees to help it modernize','Tech companies like Apple are chasing the $3.5 trillion health care market that has been slow to adapt and change.Traditional health companies, like health insurers and hospitals, are striking back.',NULL,NULL,'2019-07-09 00:00:00','Positive','https://www.cnbc.com/2019/07/09/anthem-has-hired-many-health-tech-experts-from-apple.html','https://cdn.snapi.dev/images/v1/n/r/106009915-1562698855942gail-boudreaux-anthem-getty.jpg','CNBC','ANTM','Health-&-Wellness','0.64'),(176,'Anadarko to resume deal talks with Occidental, says bid could be ‘superior’ to Chevron’s offer','Anadarko Petroleum announces it will restart negotiations to be bought by fellow driller Occidental.',NULL,NULL,'2019-04-29 00:00:00','Neutral','https://www.cnbc.com/2019/04/29/anadarko-to-resume-deal-talks-with-o